import math  

def func_x( x, y): 
    return (x*(1-(x/500))-0.02*x*y) 
def func_y( x, y ): 
    return (-y+0.01*x*y) 

def euler( t0, y0, x0, h, tf ): 
    valuesx = []
    valuesy = []
    valuest = []
    while t0 < tf: 
        y0 = y0 + h * func_y(x0, y0) 
        x0 = x0 + h * func_x(x0, y0) 
        t0 = t0 + h 
        valuesx.append(x0)
        valuesy.append(y0)
        valuest.append(t0)
    return (valuesx,valuesy,valuest)

x,y,t = euler(0, 20, 20, 0.01, 30)

